SET search_path to public, provsql ;
SELECT *, counting(provenance(), 'counting_map') FROM ( SELECT c.c_name, o.o_orderstatus, c.c_nationkey, c.c_phone FROM customer c, orders o WHERE c.c_custkey = o.o_custkey AND c.c_nationkey = 4 AND o.o_totalprice >= 52353 AND o.o_totalprice <= 141505 )t;
SELECT *, counting(provenance(), 'counting_map') FROM (  SELECT s.* FROM supplier s INNER JOIN nation n ON  s.s_nationkey = n.n_nationkey INNER JOIN region r ON  n.n_regionkey = r.r_regionkey WHERE r.r_regionkey = 0 AND s.s_acctbal < 4975 )t;
SELECT *, counting(provenance(), 'counting_map') FROM (  SELECT s.s_name, p.p_brand, p.p_name FROM supplier s, partsupp ps, part p, nation n, region r WHERE s.s_suppkey = ps.ps_suppkey AND ps.ps_partkey = p.p_partkey AND s.s_nationkey = n.n_nationkey AND n.n_regionkey = r.r_regionkey AND r.r_regionkey = 1 AND ps.ps_supplycost >= 904 AND ps.ps_supplycost <= 1715 GROUP BY p.p_brand, p.p_name, s.s_name )t;
SELECT *, counting(provenance(), 'counting_map') FROM (  SELECT DISTINCT c.c_name, o.o_orderkey, l.l_linenumber FROM customer c, orders o, lineitem l WHERE c.c_custkey = o.o_custkey AND o.o_orderkey = l.l_orderkey AND o.o_totalprice >= 84068 AND o.o_totalprice <= 141084 )t;
SELECT *, counting(provenance(), 'counting_map') FROM (  SELECT DISTINCT c.c_name, c.c_nationkey FROM customer c, orders o WHERE c.c_custkey = o.o_custkey AND o.o_totalprice > 70144 GROUP BY c.c_nationkey,c.c_name )t;
SELECT *, counting(provenance(), 'counting_map') FROM (  SELECT * FROM lineitem WHERE l_shipmode = 'RAIL' AND l_quantity < 25 AND l_linestatus = 'F' )t;
SELECT *, counting(provenance(), 'counting_map') FROM (  SELECT DISTINCT o.o_orderdate, o.o_custkey FROM orders o, customer c WHERE o.o_custkey = c.c_custkey AND o.o_totalprice > 26930 AND c.c_nationkey = 22 AND o.o_orderstatus IN ('P','F') )t;
SELECT *, counting(provenance(), 'counting_map') FROM (  SELECT p.p_name, p.p_mfgr, p.p_partkey, p.p_retailprice FROM part p INNER JOIN partsupp ps ON p.p_partkey = ps.ps_partkey INNER JOIN supplier s  ON ps.ps_suppkey = s.s_suppkey INNER JOIN nation n    ON s.s_nationkey = n.n_nationkey INNER JOIN region r    ON n.n_regionkey = r.r_regionkey WHERE r.r_regionkey = 3 AND ps.ps_supplycost < 672 )t;
SELECT *, counting(provenance(), 'counting_map') FROM (  SELECT p.p_type, p.p_name, s.s_name, ps.ps_supplycost FROM part p, partsupp ps, supplier s WHERE p.p_partkey = ps.ps_partkey AND ps.ps_suppkey = s.s_suppkey AND p.p_size >= 45 AND p.p_size <= 49 GROUP BY p.p_type, p.p_name, s.s_name, ps.ps_supplycost )t;
